const container = document.getElementById('container');
const canvas = document.getElementById('canvasA');
const file = document.getElementById('fileupload');
canvas.width = window.innerWidth;
canvas.height = window.innerHeight;
const ctx = canvas.getContext('2d');
ctx.lineWidth = 4;
ctx.globalCompositeOperation = 'difference';
let audioSrc;
let analyser;

container.addEventListener('click', function(){
    const audioA = document.getElementById('audioA');
    audioA.src = 'data:audio/x-wav;base64,'
    const audioCtx = new (window.AudioContext)();
    audioA.play();
    audioSrc = audioCtx.createMediaElementSource(audioA);
    analyser = audioCtx.createAnalyser();
    audioSrc.connect(analyser);
    analyser.connect(audioCtx.destination);
    analyser.fftSize = 512;
    const bufferLength = analyser.frequencyBinCount;
    const dataArray = new Uint8Array(bufferLength);

    const barWidth = 15;
    let barHeight;
    let x;

    function animate(){
        x = 0;
        ctx.clearRect(0, 0, canvas.width, canvas.height);
        analyser.getByteFrequencyData(dataArray);
        drawVisualiser(bufferLength, x, barWidth, barHeight, dataArray)
        requestAnimationFrame(animate);
    }
    animate();
});

file.addEventListener('change', function(){
    const files = this.files;
    const audioA = document.getElementById('audioA');
    audioA.src = URL.createObjectURL(files[0]);
    audioA.load();
    audioA.play();

    audioSrc = audioCtx.createMediaElementSource(audioA);
    analyser = audioCtx.createAnalyser();
    audioSrc.connect(analyser);
    analyser.connect(audioCtx.destination);
    analyser.fftSize = 512;
    const bufferLength = analyser.frequencyBinCount;
    const dataArray = new Uint8Array(bufferLength);

    const barWidth = 15;
    let barHeight;
    let x;

    function animate(){
        x = 0;
        ctx.clearRect(0, 0, canvas.width, canvas.height);
        analyser.getByteFrequencyData(dataArray);
        drawVisualiser(bufferLength, x, barWidth, barHeight, dataArray)

        requestAnimationFrame(animate);

    }
    animate();
});

function drawVisualiser(bufferLength, x, barWidth, barHeight, dataArray){
    for (let i = 0; i < bufferLength; i++){
        barHeight = dataArray[i];
        ctx.save();
        ctx.translate(canvas.width/2, canvas.height/2);
        ctx.rotate(i + 4.184);
        const hue = i * 5;
        ctx.strokeStyle = 'hsl(' + hue + ',100%,' + barHeight/1 + '%)';
        ctx.beginPath();
        ctx.moveTo(0,0);
        ctx.lineTo(0, barHeight);
        ctx.arc(0, barHeight + barHeight/2, barHeight/10, 0, Math.PI * 2);
        ctx.stroke();
        x += barWidth;
        
        if (i > bufferLength * 0.6){
            ctx.beginPath();
            ctx.rotate(i + 1.184);
            ctx.stroke();
        }
        ctx.restore();
    }
}